import json
import java.io
from org.apache.commons.io import IOUtils
from java.nio.charset import StandardCharsets
from org.apache.nifi.processor.io import StreamCallback
from collections import OrderedDict

class PyStreamCallback(StreamCallback):
    def __init__(self):
        pass

    def process(self, inputStream, outputStream):
        inputText = IOUtils.toString(inputStream, StandardCharsets.UTF_8)

        # Error Details
        if inputText:
            operationOutcomeResource = json.loads(inputText, object_pairs_hook=OrderedDict)   
            clear = False         

            if "resourceType" in operationOutcomeResource:
                if operationOutcomeResource["resourceType"] == "OperationOutcome":          
                    if "issue" in operationOutcomeResource:
                        newIssues = []
                        for anIssue in operationOutcomeResource["issue"]:
                            if anIssue["severity"] != "information":
                                newIssues.append(anIssue)

                        if len(newIssues) == 0:
                            clear = True
                        else:
                            operationOutcomeResource["issue"] = newIssues
                elif operationOutcomeResource["resourceType"] == "Bundle":
                    if "entry" in operationOutcomeResource:
                        newEntries = []
                        for anEntry in operationOutcomeResource["entry"]:
                            keepEntry = True
                            resource = anEntry["resource"]
                            if resource["resourceType"] == "OperationOutcome":
                                if "issue" in resource:
                                    newIssues = []
                                    for anIssue in resource["issue"]:
                                        if anIssue["severity"] != "information":
                                            newIssues.append(anIssue)

                                    if len(newIssues) != 0:
                                        resource["issue"] = newIssues
                                    else:
                                        keepEntry = False
                            if keepEntry:
                                newEntries.append(anEntry)

                        if len(newEntries) == 0:
                            clear = True
                        else:
                            operationOutcomeResource["entry"] = newEntries

            if clear:
                outputStream.write(bytearray(''))
            else:
                outputStream.write(bytearray(json.dumps(operationOutcomeResource, indent=4).encode("utf-8")))

flowFile = session.get()
flowFile = session.write(flowFile, PyStreamCallback())
flowFile = session.putAttribute(flowFile, "Content-Length", str(flowFile.getSize()))

session.transfer(flowFile, REL_SUCCESS)
session.commit()
